/**
 * @param {string} s
 * @return {number}
 */
// 遍历字符串
// 保存每个字符的最长不重复字符串, 用对象保存
// 比较保存的字符串长度

function insertNext (obj, arr, i, j) {
    const item = arr[j]
    if (item !== undefined && obj[i][item] === undefined) {
        obj[i][item] = item
        return true
    }
    return false 
}

var lengthOfLongestSubstring = function (s) {
    const arr = s.split('')
    const obj = {}
    for (let i = 0; i < arr.length; i++) {
        let item = arr[i]
        obj[i] = {}
        obj[i][item] = item
        for (let j = i + 1; j < arr.length; j++) {
            const isSuccess = insertNext(obj, arr, i, j)
            if (!isSuccess) {
                break
            }
        }
    }
    let max = 0
    for (let key in obj) {
        max = Math.max(max, Object.keys(obj[key]).length)
    }
    return max
};
